import React from 'react';
import styled from 'styled-components';

const SecondFoldWrapper = styled.div`
  width: 100%;
  background-color: #FFFFFF;
  padding: 32px 40px;

  .list {
    padding-left: 0;
    list-style: none;
    margin-bottom: 32px;
    display: flex;
    align-items: center;
    justify-content: space-around;

    li {
      color: #748c02;
      font-weight: 700;
      text-transform: uppercase;
      font-size: 22px;
      line-height: 1.09;
      letter-spacing: -0.25px;
      text-align: center;

      img {
        display: block;
        margin: 0 auto 16px;
        object-fit: contain;
        object-position: bottom;
      }
    }
  }

  .offer-img {
    text-align: center;
    margin-bottom: 24px;

    img {
      height: 120px;
    }
  }

  p {
    margin-bottom: 24px;
  }

  img {
    height: 288px;
  }
`;

const SecondFold = () => {
  return (
    <SecondFoldWrapper>
      <ul className="list">
        <li>
          <img src="./images/window.png" alt="window" width="60" height="60" />
          Windows
        </li>
        <li>
          <img src="./images/siding.png" alt="siding" width="60" height="60" />
          Siding
        </li>
        <li>
          <img src="./images/roof.png" alt="roof" width="120" height="60" />
          Roof
        </li>
      </ul>

      <div className="offer-img">
        <img src="./images/offer.svg" alt="offer" />
      </div>

      <p>Limited Time Only. Offer May Explire. Improve the curb appeal and energy efficiency of your home with the installation o fnew windows. Our experts offer FREE in home design consultations in the Cincinnati and Northern Kentucky area. Contact us today for all your window, roofing and siding needs.</p>
      <img src="./images/house.png" alt="house" />

      <div>
        <button>Click to Call</button>
        Contact Us for a Free In-Home <br />
        Design Consultations Today
      </div>
    </SecondFoldWrapper>
  );
};

export default SecondFold;
